#1 Listar toda la información de los productos disponibles que contengan en el título el término “Harry Potter”. 

SELECT *
FROM PRODUCTO
WHERE Titulo LIKE '%Harry Potter%' AND Estado ='disponible';

#2 Listar el Identificador, Título y Precio de los productos marcados como favoritos del usuario con correo electrónico juan@mail.com. 

SELECT P.IdP, P.Titulo, P.Precio_Salida
FROM PRODUCTO P
INNER JOIN FAVORITO F ON P.IdP = F.Producto
INNER JOIN USUARIO U ON F.Usuario= U.IdU
WHERE U.email ='juan@mail.com';

#3 ¿Cuál es el importe total de las ventas del usuario juan@mail.com? 

SELECT SUM(Precio_Venta) AS Importe_total
FROM VENDIDO V
INNER JOIN PRODUCTO P ON P.IdP = V.IdP
INNER JOIN USUARIO U ON P.Vendedor = U.IdU
WHERE U.email ='juan@mail.com';

#4 Obtener el número de productos disponibles por cada una de las categorías finales. 

SELECT C.Nombre AS Categoria_Final,
COUNT(P.idP) AS Productos_Disponibles
FROM CATEGORIA C
LEFT JOIN PRODUCTO P ON C.ID_Cat = P.Categoria AND P.Estado = 'disponible'
WHERE C.ID_Cat NOT IN (SELECT DISTINCT Cat_Padre FROM CATEGORIA WHERE Cat_Padre IS NOT NULL)
GROUP BY C.ID_Cat, C.Nombre;

#5 ¿Quién es el usuario que ha vendido más productos en la plataforma?

WITH Productos_vendidos AS (SELECT U.Nombre, COUNT(V.IdP) AS Productos_vendidos
                                     FROM USUARIO U
                                     JOIN PRODUCTO P ON U.idU = P.Vendedor
                                     JOIN VENDIDO V ON P.idP = V.IdP
                                     GROUP BY U.Nombre)
SELECT Nombre
FROM Productos_vendidos
WHERE Productos_vendidos = (SELECT MAX(Productos_vendidos) FROM Productos_vendidos);

#6 Obtener el título y el precio de los productos vendidos por el usuario ana@mail.com ordenados según el número de estrellas indicadas por el comprador 

SELECT P.Titulo, V.Precio_Venta, O.EstrellasC
FROM VENDIDO V
INNER JOIN PRODUCTO P ON P.IdP = V.IdP
INNER JOIN USUARIO U ON P.Vendedor = U.IdU
INNER JOIN OPINION_COMPRADOR O ON O.Producto = P.IdP
WHERE U.email='ana@mail.com'
ORDER BY O.EstrellasC DESC;

#7 Obtener el número de usuarios registrados en la plataforma agrupados por ciudad. 

SELECT 
   SUBSTRING(CP,1,2) AS Provincia,
   COUNT(IdU) AS Num_usuarios_registrados
FROM USUARIO
WHERE CP IS NOT NULL
GROUP BY Provincia
ORDER BY Provincia;

#8 Obtener la información de los productos vendidos el día 9 de septiembre de 2024 que contengan en la opinión del comprador los términos “mal”, “pésimo” o “defectuoso”. 

SELECT *
FROM VENDIDO V
INNER JOIN OPINION_COMPRADOR O ON O.Producto = V.IdP
WHERE V.Fecha_Venta ='2024-09-09'
AND (O.OpinionC LIKE '%mal%' OR O.OpinionC LIKE '%pésimo%' OR O.OpinionC LIKE '%defectuoso%');

#9 Cuántos productos se han reservado desde el 1 de enero al 31 de enero del 2023. 

SELECT COUNT(IdP) AS Num_productos_reservados
FROM RESERVADO 
WHERE Fecha_reserva BETWEEN '2023-01-01' AND '2023-01-31';

#10 Listar el identificador y el nombre de las categorías raíz existentes en la Base de Datos (categorías de primer nivel). 

SELECT ID_Cat, Nombre
FROM CATEGORIA
WHERE Cat_Padre IS NULL;

#11 Obtener la media de puntuación en estrellas de los usuarios de la plataforma que viven en Madrid que les han otorgado sus compradores.  

SELECT AVG (OV.EstrellasV) AS Media_Estrellas
FROM OPINION_VENDEDOR OV
INNER JOIN VENDIDO V ON OV.Producto = V.IdP
INNER JOIN PRODUCTO P ON V.IdP = P.IdP
INNER JOIN USUARIO U ON P.Vendedor = U.IdU
WHERE U.CP LIKE '28%';
